import React from 'react';
import './work.css';

function Work(props) {
    const work = props.data;
    const listWorks = work.map((item, i)=>
         <div className ="ListWork" key = {i} >
            <div className="Position">
                {item.position}
            </div> 
            <div className = "Company">
                {item.company} {item.fe_desde} - {item.fe_hasta}
            </div>
            <div className = "Description">
                {item.description}
            </div>
         </div>
    )
    return (
        <div className="Work">
            <span className="subtitle">EXPERIENCIA</span>
            {listWorks}
        </div>
    )
}

export default Work;
